import Button from '../components/Button'

export default {
  component : Button, // 스토리북에 보이는 title
  title : "Button", // 사용될 컴포넌트 ( import된 그거 )
  argTypes : { handleClick : { action : "asdf"} }, // props로 사용될 타입 정의 (Controls에서 사용 가능)
}

const Template = args => <Button {...args} />

export const Default = Template.bind({})
Default.args = {
  backgroundColor : "white",
  label : "Press me",
  size : "md",
  color : "#1E1E1E",
  fontWeight : "400",
  border : '',
}

export const Red = Template.bind({})
Red.args = {
  backgroundColor : "red",
  label : "Press me",
  size : "md",
  color : "#1E1E1E",
  fontWeight : "400"
}

export const Green = Template.bind({})
Green.args = {
  backgroundColor : "green",
  label : "Press me",
  size : "md",
  color : "#1E1E1E",
  fontWeight : "400"
}
